textOriginal:
Agora vocês conseguiram se superar. Bolsonaro foi prejudicado, comprovadamente teve milhares de inserções a menos que o candidato de vocês, mas não pode reclamar, porque vocês não querem. É isso mesmo? Não pode reclamar porque o outro candidato teve mais votos no Nordeste, então se falar que ele foi prejudicado, na cabeça de vocês contribui com uma narrativa, que vocês mesmo estão criando. Que viagem! Essa é a narrativa das narrativas. Parabéns!!! 
Vamos falar de verdades. Conhecem o PNDH-3?
Programa Nacional de Direitos Humanos - PNDH-3? Não conhecem? Foi um decreto assinado pelo Lula em 2009 e na época considerado uma ameaça as liberdades e direitos democráticos garantidos na Constituição Federal, entre eles:
- Legalização do Aborto;
- Censura dos Meios de Comunicação;
- Proibição de exibir símbolos religiosos;
- Liberação de drogas;
- Aprovação da invasão de terras e propriedades urbanas e rurais.
Esse decreto (DECRETO Nº 7.037, DE 21 DE DEZEMBRO DE 2009) mostra exatamente as reais intenções do PT. 
Infelizmente, isso não é nenhuma Fake News ou narrativa mentirosa. 
Confira algumas matérias da época falando do PNDH-3 - https://www.youtube.com/watch?v=dTDiovjORww
